import React from 'react';

const Rank = ({ name, entries }) => {
  return (
    <div>
      {/* <div className='f1'>{`YASH RAJ`}<div/> */}
      <div className='white f3'>
        {`${name} your current entry countnumber is...`}
      </div>
      <div className='green  f1'>
        {entries}
      </div>
    </div>
  );
}

export default Rank;
